    def to_grid(self, flat_list):
        """
        Convert a 1D list into a 2D list of size n x m.

        Args:
            flat_list (list): 1D list to be converted.
            n (int): Number of rows in the 2D list.
            m (int): Number of columns in the 2D list.

        Returns:
            list of list: 2D list with dimensions n x m.
        """

        n = self._row
        m = self._column

        if len(flat_list) != n * m:
            raise ValueError("The size of the 1D list does not match the specified dimensions.")

        # Create the 2D list
        return [flat_list[i * m:(i + 1) * m] for i in range(n)]

    def extract_state_vector(self, grid, player_x, player_y):
        """
        Extract a fixed-size state vector from the grid, including coin and wall information.

        Args:
            grid (list of list): n x m grid with positive values for coins, -1 for walls, and 0 for empty cells.
            player_x (int): X-coordinate of the player's position.
            player_y (int): Y-coordinate of the player's position.
            k (int): Number of closest coins to include in the state vector.

        Returns:
            list: Fixed-size state vector.
        """
        n = len(grid)
        m = len(grid[0])

        # Find all coins and their distances from the player
        coins = []
        for i in range(n):
            for j in range(m):
                value = grid[i][j]
                if value > 0:  # Coin found
                    distance = abs(player_x - i) + abs(player_y - j)
                    distance = distance / value
                    coins.append((distance, i, j, grid[i][j]))  # (distance, x, y, value)

        # Sort coins by distance and select the top k
        coins = sorted(coins)[:self.k]
        coin_features = []
        for distance, x, y, value in coins:
            rel_x, rel_y = x - player_x, y - player_y  # Relative position
            coin_features.extend([rel_x, rel_y, value])

        # Pad with zeros if fewer than k coins
        while len(coin_features) < self.k * 3:
            coin_features.append(0)

        # Find the nearest wall in each direction (N, E, S, W)
        wall_distances = [n, m, n, m]  # Initialize to max distances (N, E, S, W)
        for i in range(player_x - 1, -1, -1):  # North
            if grid[i][player_y] == -1:
                wall_distances[0] = player_x - i
                break
        for j in range(player_y + 1, m):  # East
            if grid[player_x][j] == -1:
                wall_distances[1] = j - player_y
                break
        for i in range(player_x + 1, n):  # South
            if grid[i][player_y] == -1:
                wall_distances[2] = i - player_x
                break
        for j in range(player_y - 1, -1, -1):  # West
            if grid[player_x][j] == -1:
                wall_distances[3] = player_y - j
                break

        # Combine coin features and wall distances
        state_vector = coin_features + wall_distances
        return state_vector